import React from 'react';

class App extends React.Component {
    render() {
        return (
            <div>
                <div id='title'><h1>Pomodoro Clock</h1></div>
                  <div id='breakLength'></div>
                    <div id='sessionLength'></div>
                      <div id='clock'></div>
                        <div id='clockBtns'></div>
            </div>
        )
    }
}

export default App;
